def code_execution(input_grid, output_grid, predicted_grid):
    """Executes code and provides feedback."""
    
    input_height = len(input_grid)
    input_width = len(input_grid[0]) if input_height > 0 else 0
    output_height = len(output_grid)
    output_width = len(output_grid[0]) if output_height > 0 else 0
    predicted_height = len(predicted_grid)
    predicted_width = len(predicted_grid[0]) if predicted_height > 0 else 0
    
    print(f"Input Dimensions: {input_height}x{input_width}")
    print(f"Output Dimensions: {output_height}x{output_width}")
    print(f"Predicted Dimensions: {predicted_height}x{predicted_width}")

    match = (np.array(output_grid) == np.array(predicted_grid)).all()
    print(f"Match: {match}")
    
    input_objects = {}
    output_objects = {}
    
    for row in range(input_height):
      for col in range(input_width):
          color = input_grid[row][col]
          if color != 0:
              if color not in input_objects:
                  input_objects[color] = 0
              input_objects[color] += 1

    for row in range(output_height):
        for col in range(output_width):
            color = output_grid[row][col]
            if color != 0:
                if color not in output_objects:
                    output_objects[color] = 0
                output_objects[color] += 1
    
    print(f"Input Objects {input_objects}")
    print(f"Output Objects {output_objects}")


